import jsTPS_Transaction from "../common/jsTPS.js"
/**
 * AddSong_Transaction
 * 
 * @author McKilla Gorilla
 * @author ?
 */
export default class AddSong_Transaction extends jsTPS_Transaction { 
    constructor() {
        super();
        const store = useGlobalStore();
    }

    doTransaction() {
        this.store.addSong();
    }
    
    undoTransaction() {
        this.store.deleteSongT();
    }
}
